INSERT INTO `articles` (`datetime`, `img_ogl`, `title`, `subtitle`, `description`, `html_code`, `category`, `num`, `html_file`, `alias`, `catalog`, `html_source`) VALUES
('2014-08-01 00:00:00', 'img_ogl.png', 'Салон «Эндорфина – Империя СПА»', 'НОВЕЙШИЕ ТЕХНОЛОГИИ + ПРОФЕССИОНАЛИЗМ = 100% РЕЗУЛЬТАТ', 'Основными принципами нашей работы является:<br />&#8211;&#160;Использование только безопасных и эффективных методик в индустрии красоты<br />&#8211;&#160;Работа на современном оборудовании<br />&#8211;&#160;Строгое соблюдение санитарно-гигиенических норм<br />', '', 'organisations', 1, 'endorfina.html', 'endorfina', 'articles/organisations/endorfina', ''),
('2014-08-02 00:00:00', 'img_ogl.png', 'Семейный банный компекс Премиум-класса «ГиппократЪ»', 'Инновационные технологии в области банного дела', 'Одним из последних и самых масштабных нововведений стало открытие уникального банного комплекса «ГиппократЪ».<br /> Что делает этот комплекс единственным в своем роде?<br />То, что входит в его состав и форма организации его работы<br />', '', 'organisations', 2, 'hippocrat.html', 'hippocrat', 'articles/organisations/hippocrat', ''),
('2014-08-03 00:00:00', 'img_ogl.png', 'ООО «Западно-Сибирская промышленная группа»', 'Транспортные и складские услуги по последнему слову техники', 'ООО «Западно-Сибирская промышленная группа» предлагает услуги по приему, хранению и отгрузке товарно-материальных ценностей на производственной базе, расположенной в ЯНАО, в районе станции Коротчаево, поселок Лимбяяха, а также по транспортировке грузов собственным автотранспортом.', '', 'organisations', 3, 'zspg.html', 'zspg', 'articles/organisations/zspg', ''),
('2015-01-01 00:00:00', 'img_ogl.jpg', 'Журнал-проспект «ПРЕЗЕНТАЦИЯ»', '', 'Хотите представить широкой публике вашу уникальную продукцию, товары и услуги?<br/>\nНовые торговые марки и технологии, которых еще не было в нашем городе?<br/>\nХотите, чтобы ваша выручка выросла в несколько раз за несколько дней?<br/>\nТогда наше новое издание для вас!', '', 'offers', 4, 'presentation.html', 'presentation', 'articles/offers/presentation', 'file'),
('2014-08-31 00:00:00', 'img_ogl.jpg', 'Магазин канцтоваров «Кристи»', '20 лет успешной работы на рынке канцелярских товаров и офисных принадлежностей!', 'Магазин «Кристи», расположенный в самом центре, на пр. Губкина, напротив салона «М.Видео», давно и хорошо известен  в нашем городе.<br />Основным достоинством магазина является комплекс услуг, которые он оказывает помимо продажи.', '', 'organisations', 5, 'kristi.html', 'kristi', 'articles/organisations/kristi', ''),
('2014-09-02 00:00:00', 'img_ogl.jpg', 'Слепочки детских ручек и ножек малыша!', 'Объёмные, точные копии ручек и ножек Вашего малыша.', 'В рамочке под стеклом.<br />\r\nВ отличие от наборов — это не гипс, а керамика, более точно копирует линии жизни, и не трескается с годами.<br />\r\nНастоящая семейная ценность будет радовать Вас многие годы!<br />', '', 'organisations', 6, 'slepochki.html', 'slepochki', 'articles/organisations/slepochki', ''),
('2014-09-04 00:00:00', 'img_ogl.jpg', 'Юридическая фирма «ЦЕНТР ПРАВА»', 'Известная юридическая фирма расширяет сферу своей деятельности в сторону альтернативных вариантов решения споров', 'Теперь она учреждает такие проекты, как Третейский суд и Учреждение арбитража и медиации.<br>\nПроекты относятся к альтернативным вариантам решения споров и призваны как повышать профессионализм сотрудников и партнеров, так и способствовать укреплению делового статуса компании.<br>\nПодробнее о нововведениях вы можете прочитать на портале компании арбитраж89.рф', '', 'organisations', 7, 'centr-prava.html', 'centr-prava', 'articles/organisations/centr-prava', ''),
('2014-09-08 00:00:00', 'img_ogl.jpg', 'ООО «Сибрегионгазстрой»', 'Крупнейшая в регионе компания — строитель газопроводов', 'Когда компания ООО «Сибрегионгазстрой» обратилась к нам с просьбой разместить рекламную информацию в телефонном справочнике, основными задачами стали: показать сферы ее деятельности, географию расположения различных объектов и основные реализованные ею проекты.<br>\nВ той или иной степени это отражено во всех представленных вариантах макетов.', '', 'organisations', 8, 'sibregiongazstroy.html', 'sibregiongazstroy', 'articles/organisations/sibregiongazstroy', ''),
('2014-09-17 00:00:00', 'img_ogl.jpg', 'Три макета для магазина «Готовые шторы»', 'Мы не смогли показать всю красоту штор, но сделали нечто большее.', '«Готовые шторы» (мкр. Мирный, 1/6) — небольшой, но очень вместительный магазин с огромным ассортиментом штор, занавесей и многих других товаров, делающих ваш дом по-настоящему уютным и заслуживающим эпитета «Дом, милый дом»', '', 'organisations', 9, 'gotovye-shtory.html', 'gotovye-shtory', 'articles/organisations/gotovye-shtory', ''),
('2014-09-21 00:00:00', 'img_ogl.jpg', 'Ветеринарная клиника «Ласка»', 'Полный комплекс услуг по профилактике и лечению Ваших домашних питомцев.', 'Роль домашних животных в нашей жизни трудно переоценить. Для кого-то они стали по-настоящему любимыми членами семьи. А для кого-то — даже единственными любящими и любимыми существами.<br>В то же время не секрет, что и животные иногда болеют и нуждаются в нашей помощи. Точнее — в помощи ветеринарного врача. А еще точнее — в тех услугах, которые оказывает единственная в своем роде в нашем городе Ветеринарная клиника «Ласка»', '', 'organisations', 10, 'laska.html', 'laska', 'articles/organisations/laska', ''),
('2014-10-02 00:00:00', 'img_ogl.jpg', 'ООО «Ямалнефтестрой»', 'Оптовая торговля ГСМ, транспортные услуги, отсыпка дорог', 'Компания начинала как представитель «Русойла», но со временем превратилась в крупнейшего в регионе поставщика ГСМ. Кроме того, оказывает транспортные услуги по доставке (в первую очередь, ГСМ) и осуществляет отсыпку дорог.', '', 'organisations', 11, 'yamalneftestroy.html', 'Yamalneftestroy', 'articles/organisations/yamalneftestroy', ''),
('2014-10-20 00:00:00', 'img_ogl.jpg', 'Журнал-проспект «Презентация». Выпуск 2', 'Первый полноценный выпуск «Презентации», как раз такой, какой он и должен быть — уже проспект и почти журнал.', 'Вышел в свет очередной выпуск журнала-проспекта «Презентация». Основные рекламодатели — Ветеринарная клиника «Ласка» и сеть магазинов «Умка» и «Пряжа. Товары для рукоделия»', '', 'editions', 12, 'presentation2.html', 'presentation2', 'articles/editions/presentation2', ''),
('2014-10-24 00:00:00', 'img_ogl.jpg', 'Сеть магазинов детской одежды «Умка»', 'Комфорт. Качество. Уют.<br>Для ваших детей. В любой сезон и в любую погоду!', 'Без преувеличения, лучшие в городе магазины детской одежды.<br>Одежда именно такая, как изображена на рекламных макетах, и именно то, во что следует одевать ваших детей.<br>Искренне желаем вам лично их посетить эти магазины и самим в этом убедиться.', '', 'organisations', 13, 'umka.html', 'umka', 'articles/organisations/umka', ''),
('2014-10-25 00:00:00', 'img_ogl.jpg', 'Магазины «Умка»: Товары для рукоделия. Пряжа.', 'Самый большой выбор товаров для рукоделия и вязания. Бисер. Стразы.', 'Сеть магазинов располагает настолько широким ассортиментом, что для размещения в справочнике его пришлось переименовывать.<br>Если раньше они назывались просто «Пряжа», то теперь на первое место поставили «Товары для рукоделия»', '', 'organisations', 14, 'umka-pryazha.html', 'umka-pryazha', 'articles/organisations/umka-pryazha', ''),
('2015-01-05 00:00:00', 'img_ogl.jpg', 'Инструкция по распространению', 'Полное положение по разноске печатной продукции по почтовым ящикам', 'Данная инструкция предназначена для распространителей и определяет общие принципы и правила разноски газет по почтовым ящикам.', '', 'editions', 15, 'instr_raspr.html', 'instr_raspr', 'articles/editions/instr_raspr', ''),
('2015-01-06 00:00:00', 'img_ogl.jpg', 'Топ-новости. Номер один', 'Вышел первый номер газеты «Топ-новости»', '«Топ-новости» — первая бесплатная массовая информационно-рекламная газета с разноской по почтовым ящикам.<br>Основные рекламодатели — наши постоянные партнеры Ветеринарная клиника «Ласка»  и Риелторская компания «Абсолют».', '', 'editions', 16, 'top01.html', 'top01', 'articles/editions/top01', ''),
('2015-02-10 00:00:00', 'img_ogl.jpg', 'Карта города на 2015 год', 'Вышел четвертый выпуск Карты (План-схемы) города Новый Уренгой', 'Карта города Новый Уренгой в виде журнала — самое первое наше издание, выходит с 2010 года.<br>Это — глянцевый журнал формата А4 (210 х 297 мм) в ламинированной обложке.', '', 'editions', 17, 'plan04.html', 'plan04', 'articles/editions/plan04', ''),
('2015-03-15 00:00:00', 'img_ogl.jpg', 'Главное информационное событие 2015 года', 'Вышел четвертый выпуск Телефонного справочника города', 'В отличие от предыдущего он вышел в белой, а не красной обложке.<br/>В выпуске справочника приняло участие почти 100 рекламодателей и мы рады всех их представить вашему вниманию.', '', 'editions', 18, 'sprav04.html', 'sprav04', 'articles/editions/sprav04', 'file'),
('2015-04-12 12:00:00', 'img_ogl.jpg', 'Как сделать себе рекламу и заработать на этом?', 'Напишите статью о любой организации нашего города, пришлите ее нам и выиграйте до 5000 рублей!', 'Газета «Топ-новости» объявляет акцию, в которой вы можете не только сделать рекламу своей или любой другой компании, но и заработать на этом.', '', 'actions', 19, 'action01.html', 'action01', 'articles/actions/action01', 'file'),
('2015-04-14 23:25:53', 'img_ogl.jpg', 'Как правильно выбрать кухню', 'Советы специалистов фабрики «КОМФОРТ»', 'Кухня – одно из важнейших помещений в доме, где мы проводим немало времени, поэтому в кухне все должно быть красиво, удобно и рационально.<br/>\nО том, как правильно обустроить свою кухню, делятся специалисты Мебельной фабрики «КОМФОРТ» – лидера этого рынка в нашем городе.', '', 'organisations', 20, 'komfort-02.html', 'Komfort-02', 'sprav/10-15-mebel-i-interer-kovry/komfort-fabrika-mebeli/komfort-02', 'file'),
('2015-04-18 15:41:46', 'img_ogl.png', 'О фабрике &laquo;КОМФОРТ&raquo;', 'Принцип доступности и качества как основа торговой политики', 'На сегодняшний день функционирует три магазина по городу Новый Уренгой, и один магазин в городе Надым. Современная производственная база позволяет нам разрабатывать качественную продукцию на основе проверенных и экологически чистых материалов, а успешная система управления помогает максимально быстро реагировать на внешние изменения и эффективно управлять рыночными процессами.', '', 'actions', 21, 'komfort-01.html', 'komfort-01', 'sprav/10-15-mebel-i-interer-kovry/komfort-fabrika-mebeli/komfort-01', 'file'),
('2015-04-18 15:51:48', 'img_ogl.jpg', 'Магазин детской одежды «Торговый зал № 1»', 'Простое решение непростой задачи', 'Одевать ребёнка задача непростая, для этого нужен тщательный и внимательный подход к выбору одежды. Не нужно забывать и о комфорте ребёнка!', '', 'actions', 22, 'torgovyy-zal-1.html', 'torgovyy-zal-1', 'sprav/10-11-tovary-dlya-detey/torgovyy-zal-1/torgovyy-zal-1', 'file'),
('2015-04-26 00:00:00', 'img_ogl.jpg', 'Автодом: комфорт и защита вашего автомобиля', 'Webasto и Starline: только преимущества, ничего лишнего', 'Машины любят все. Особенно теплые и кофортные. Поэтому их иногда угоняют. Сделать машину комфортной и сразу же защитить ее от угона вам поможет компания Автодом', '', 'actions', 23, 'avtodom-01.html', 'Avtodom', 'sprav/19-08-avtoservis-sto/avtodom/avtodom-01', 'file'),
('2015-05-06 14:33:24', 'img_ogl.jpg', 'Газета «Топ-новости»', '', 'Самое оперативное рекламно-информационное издание с наибольшим охватом потенциальных покупателей — 17 000 экз. Формат А3 (297 х 420 мм).\nРаспространяется бесплатно по почтовым ящикам.', '', 'offers', 24, 'top-news.html', 'top-news', 'articles/offers/top-news', 'file'),
('2015-05-06 15:13:27', 'img_ogl.jpg', 'Новый Уренгой. Телефонный справочник города', '', 'Глянцевый журнал формата А4 (210 х 297 мм) — самый полный адресно-телефонный справочник по предприятиям и организациям города.', '', 'offers', 25, 'dictionary.html', 'dictionary', 'articles/offers/dictionary', 'file'),
('2015-05-06 15:19:55', 'img_ogl.jpg', 'Новый Уренгой. План-схема города', '', 'Самое первое наше издание: выпускается с 2010 года. Представляет из себя глянцевый буклет формата А4 (210 х 297 мм), периодичность — 1 раз в год.', '', 'offers', 26, 'plan.html', 'plan', 'articles/offers/plan', 'file'),
('2014-08-04 00:00:00', 'img_ogl.jpg', 'Издана и поступила в продажу Настенная карта города Новый Уренгой', 'Для нас это стало главным событием лета 2014 года', 'Настенная карта города Новый Уренгой впервые за много лет издана и поступила в продажу.<br />Еще когда наша компания осенью 2010 года начинала свою рекламно-издательскую деятельность с газеты «Жил-был город...» и План-схемы города в виде журнала, к нам неоднократно обращались с просьбой выпустить настенную карту...<br />И вот, спустя почти 4 года, это, наконец, осуществилось.<br />', '', 'editions', 28, 'mapwall.html', 'mapwall', 'articles/editions/mapwall', ''),
('2015-05-09 16:24:56', 'img_ogl.jpg', 'Знакомство с компанией &laquo;СеверСталь&raquo;', 'Большие перспективы и огромный потенциал в производстве профлиста и металлочерепицы', 'Добрый день! Хочу познакомить вас с компанией ООО &laquo;СеверСталь&raquo;, недавно открывшейся в нашем городе. Многие могут подумать что это филиал крупной металлургической компании, однако это не так.', '', 'actions', 29, 'severstal.html', 'Severstal', 'sprav/18-07-proizvodstvo-stroymaterialov/severstal', 'file'),
('2015-05-10 08:53:10', 'img_ogl.jpg', 'Строительный магазин «Бригадир»', 'Только мировые бренды и только уникальные услуги', 'Первое, на что обращаешь внимание, заходя в Строительный магазин «Бригадир» – огромный выбор самых разных материалов, предназначенных для строительства и ремонта от самых разных производителей мирового уровня.<br />\nИ в то же время здесь оказываются услуги, которые можно получить только здесь и нигде больше.', '', 'actions', 30, 'Brigadir.html', 'Brigadir', 'sprav/11-04-stroitelnye-materialy/brigadir/Brigadir', 'file'),
('2015-05-29 20:15:17', 'img_ogl.jpg', 'Ямальские деликатесы', 'Оптовая и розничная торговля ямальскими деликатесами. Производство и переработка мяса и рыбы', 'Знаменитый муксун, щекур, пыжьян, вкусное и полезное мясо оленины – всё это вы можете теперь приобрести благодаря компании "Ямальские деликатесы", название которой говорит само за себя.', '', 'actions', 31, 'Delicatessen.html', 'Delicatessen', 'sprav/17-06-pishcevaya-promyshlennost/Yamalskie-delikatesy', 'file'),
('2015-05-29 20:17:31', 'img_ogl.jpg', 'Кузница кадров для самого богатого региона России', 'Новоуренгойский многопрофильный колледж и его Учебный центр профессиональной квалификации', 'В своей жизни человек сталкивается со многими проблемами и одна из основных – как найти интересную работу с достойной зарплатой.\nЭтому во многом посвящена данная статья.', '', 'actions', 32, 'College.html', 'College', 'sprav/04-03-srednee-professionalnoe-obrazovanie/College', 'file');
