(1, '2014-09-10 00:00:00', 'В Сударушке (Дом быта) открылась Турецкая сауна Хам(м)ам, обрудованная по последнему слову банной техники. Тел 26-30-33', 'В Сударушке (Дом быта) открылась Турецкая сауна Хам(м)ам, оборудованная по последнему слову банной техники. Тел 26-30-33', 'dictionary', 'В Сударушке (Дом быта) открылась Турецкая сауна Хам(м)ам'),
