(6, '2014-09-10 17:36:57', 'Удалено Ателье Иголочка ул. Ямальская, 19, 1 этаж: тел. 260-919 не отвечает, вместо него теперь Фирма «Орион» (Канцтовары, офисные аксессуары)', 'Удалено Ателье Иголочка ул. Ямальская, 19, 1 этаж: тел. 260-919 не отвечает, вместо него теперь Фирма «Орион» (Канцтовары, офисные аксессуары)', 'dictionary', 'Удалено Ателье Иголочка ул. Ямальская, 19, 1 этаж: тел. 260-919 '),
