(104, '2015-05-28 16:28:36', '<a href="http://sprav89.ru/?org=Строительные_материалы" class="news_a">Магазины стройматериалов</a> Керама закрылись. Осталась только продажа плитки на 1-м этаже <a href="http://sprav89.ru/?org=Электротехника" class="news_a">Электротехники</a>. Магазины Керама удалены из справочника. Их <a href="http://www.kerama-zapsib.ru/" class="news_a">сайт</a> остался на память.', 'Магазины стройматериалов Керама закрылись. Осталась только продажа плитки на 1-м этаже Электротехники. Магазины Керама удалены из справочника. Их сайт остался на память.', 'dictionary', 'Магазины стройматериалов Керама закрылись'),
(105, '2015-05-28 22:12:24', 'В рамках <a href="http://sprav89.ru/?new=103" class="news_a">Акции «Всё и сразу!»</a> заключен договор с <a href="http://sprav89.ru/?org=Ямальские_деликатесы_ООО" class="news_a">Торгово-производственной компанией «Ямальские деликатесы»</a>. Теперь ее реклама будет выходить в Справочнике (в 2016-2017 гг.), Карте (в 2016 году), Газете «Топ-новости» и на этом сайте (статья появится в ближайшее время).<br>Не считая всего остального, что предусмотрено акцией.', 'В рамках Акции «Всё и сразу!» заключен договор с Торгово-производственной компанией «Ямальские деликатесы». Теперь ее реклама будет выходить в Справочнике (в 2016-2017 гг.), Карте (в 2016 году), Газете «Топ-новости» и на этом сайте (статья появится в ближайшее время).\nНе считая всего остального, что предусмотрено акцией.', 'dictionary', 'В рамках Акции «Всё и сразу!» заключен договор с Торгово-производственной компанией «Ямальские деликатесы»'),
(106, '2015-05-29 18:11:47', 'По <a href="http://sprav89.ru/?new=103" class="news_a">Акции «Всё и сразу!»</a> заключен договор с <a href="http://sprav89.ru/?org=Новоуренгойский_многопрофильный_колледж" class="news_a">Новоуренгойским многопрофильным колледжем</a>.<br>Теперь они тоже получат все предусмотренные Акцией рекламные услуги сейчас и в обозримом будущем.<br>Макет уже добавлен: <a href="http://sprav89.ru/?org=Новоуренгойский_многопрофильный_колледж" class="news_a">Новоуренгойский многопрофильный колледж в онлайн-справочнике</a> ', 'По Акции «Всё и сразу!» заключен договор с Новоуренгойским многопрофильным колледжем.\nТеперь они тоже получат все предусмотренные Акцией рекламные услуги сейчас и в обозримом будущем.\nМакет уже добавлен: Новоуренгойский многопрофильный колледж в онлайн-справочнике ', 'dictionary', 'Заключен договор с Новоуренгойским многопрофильным колледжем'),
(108, '2015-06-01 00:00:00', 'Для <a href="http://sprav89.ru/?org=Салоны_красоты" class="news_a">салона красоты</a> <a href="http://sprav89.ru/?org=Diva" class="news_a">Diva</a> добавлены: телефон, <a href="http://www.diva.890m.com/" class="news_a">сайт (www.diva.890m.com)</a>, сменилась электронная почта. И, конечно, добавлен макет. Как почти постоянному рекламодателю.', 'Для салона красоты Diva добавлены: телефон, сайт (www.diva.890m.com), сменилась электронная почта. И, конечно, добавлен макет. Как почти постоянному рекламодателю.', 'dictionary', 'Для салона красоты Diva добавлены телефон, сайт и макет'),
(109, '2015-06-08 00:00:00', 'Опубликована <a href="http://sprav89.ru/?art=Delicatessen" class="news_a">статья</a> про <a href="http://sprav89.ru/?org=Ямальские_деликатесы_ООО" class="news_a">Ямальские деликатесы</a> и рекламный макет', 'Опубликована статья про Ямальские деликатесы и рекламный макет', 'dictionary', 'Опубликована статья про Ямальские деликатесы и рекламный макет'),
(110, '2015-06-09 00:00:00', 'Опубликована <a href="http://sprav89.ru?art=College" class="news_a">статья "Кузница кадров для самого богатого региона России" </a> про <a href="http://sprav89.ru/?org=Новоуренгойский_многопрофильный_колледж" class="news_a">Новоуренгойский многопрофильный колледж и его Учебный центр профессиональной квалификации</a>', 'Опубликована статья "Кузница кадров для самого богатого региона России"  про Новоуренгойский многопрофильный колледж и его Учебный центр профессиональной квалификации', 'dictionary', 'Опубликована статья Кузница кадров для самого богатого региона России (про Новоуренгойский многопрофильный колледж)'),
(111, '2015-06-16 00:00:00', 'Удален Сибнефтебанк (с 1 июня 2015 года <a href="http://www.cbr.ru/press/pr.aspx?file=01062015_064737ik2015-06-01t06_45_21.htm" class="news_a">отозвана лицензия</a>)', 'Удален Сибнефтебанк (с 1 июня 2015 года отозвана лицензия)', 'dictionary', 'Удален Сибнефтебанк'),
(112, '2015-06-16 00:00:00', 'Поистине эпохальное событие — открытие <a href="http://www.7zennosti.com/" class="news_a">интернет-магазина «Семейные ценности»</a>!<br>Только здесь вы можете приобрести: ЭКО-сувениры от <a href="http://www.7zennosti.com/#!--/ccmj" class="news_a">магнитов</a> до <a href="http://www.7zennosti.com/#!gallery/ctzx" class="news_a">посуды</a>.', 'Поистине эпохальное событие — открытие интернет-магазина «Семейные ценности»!\nТолько здесь вы можете приобрести: ЭКО-сувениры от магнитов до посуды.', 'dictionary', 'Открытие интернет-магазина «Семейные ценности»!'),
(113, '2015-06-23 20:56:57', 'Изменился адрес <a href="http://sprav89.ru?org=Автомобили_Автосалоны" class="news_a">автосалона</a> <a href="http://sprav89.ru?org=Восток_Моторс_Новый_Уренгой" class="news_a">Восток Моторс Новый Уренгой</a> – Западная промзона, Панель Л', 'Изменился адрес автосалона Восток Моторс Новый Уренгой – Западная промзона, Панель Л', 'dictionary', 'Изменился адрес автосалона Восток Моторс Новый Уренгой '),
(114, '2015-06-23 00:00:00', 'Добавлена <a href="http://sprav89.ru/?org=Общественные_организации" class="news_a">Общественная организация</a> <a href="http://sprav89.ru/?org=Подари_мне_жизнь" class="news_a">Подари мне жизнь! Помощь бездомным животным</a>', 'Добавлена Общественная организация Подари мне жизнь! Помощь бездомным животным', 'dictionary', 'Добавлена Общественная организация Подари мне жизнь!');
